import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState([]);

  const fetchData = async () => {
    try {
      const response = await fetch('http://localhost:4000/jira/spr');
      const responseData = await response.json();
      setData(responseData.issues); // Set the issues array as the state
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  console.log(data)

  return (
    <div>
      <h1>JIRA Data</h1>
      <ul>
        {data.map((issue, index) => (
          <li key={index}>
            <div>Key: {issue.key}</div>
            <div>Story Points: {issue.fields.customfield_10004}</div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
